import React from 'react';

function TestImage() {
  return (
    <div style={{ padding: '20px', border: '2px solid red' }}>
      <h3>Testing Image:</h3>
      
      {/* Test 1 */}
      <div style={{ margin: '10px' }}>
        <img 
          src="/images/chocolate.png" 
          alt="Test 1" 
          style={{ width: '200px', border: '1px solid blue' }}
        />
        <p>Path: /images/chocolate.png</p>
      </div>
      
      {/* Test 2 */}
      <div style={{ margin: '10px' }}>
        <img 
          src="images/chocolate.png" 
          alt="Test 2" 
          style={{ width: '200px', border: '1px solid green' }}
        />
        <p>Path: images/chocolate.png</p>
      </div>
      
      {/* Test 3 - Direct URL */}
      <div style={{ margin: '10px' }}>
        <img 
          src="https://images.unsplash.com/photo-1571115764595-644a1f56a55c" 
          alt="Test 3" 
          style={{ width: '200px', border: '1px solid orange' }}
        />
        <p>Path: Unsplash URL (Control Test)</p>
      </div>
    </div>
  );
}

export default TestImage;
